[{'comment_id': 460604348, 'comment_body': 'Is notebook indexing based on 0 indexing, I think `item_index` should be >= `in_notebook_cell_from_pool.size()` in this case since I believe the rest of system assumes 0 is the first index in a notebook pool', 'comment_created': datetime.datetime(2020, 7, 27, 1, 32, 56, tzinfo=datetime.timezone.utc), 'commenter': 'shailpatels', 'type': 'User'}, {'comment_id': 460605374, 'comment_body': "Instead of this check you can do
` $selected = $item['user_item_map'][$this->user_id] ?? null`;

Since a similar check is performed in the C++ side and if the value does somehow become invalud/out of bounds you can fall back to using the hash by setting it null", 'comment_created': datetime.datetime(2020, 7, 27, 1, 38, 22, tzinfo=datetime.timezone.utc), 'commenter': 'shailpatels', 'type': 'User'}, {'comment_id': 460734795, 'comment_body': 'Yeah, I missed `=` in there, thanks!', 'comment_created': datetime.datetime(2020, 7, 27, 8, 40, 17, tzinfo=datetime.timezone.utc), 'commenter': 'mukul-kmr-jha', 'type': 'User'}, {'comment_id': 460738489, 'comment_body': 'are you suggesting to remove this conditional checking whether the user index is set and value lies in the valid range?', 'comment_created': datetime.datetime(2020, 7, 27, 8, 46, 24, tzinfo=datetime.timezone.utc), 'commenter': 'mukul-kmr-jha', 'type': 'User'}, {'comment_id': 461227791, 'comment_body': 'yeah since the null coalescing operater will check if the value user_item_map and this->user_id is set and not null so you can avoid the check, if the value is out of range and note there it will default to null and then fallback to the normal hashing method. I think its a cleaner way than the large if statement', 'comment_created': datetime.datetime(2020, 7, 27, 23, 28, 49, tzinfo=datetime.timezone.utc), 'commenter': 'shailpatels', 'type': 'User'}, {'comment_id': 461276213, 'comment_body': "Yeah, make sense since I'm already performing the rane validation check in CPP code, thanks:)", 'comment_created': datetime.datetime(2020, 7, 28, 2, 15, 2, tzinfo=datetime.timezone.utc), 'commenter': 'mukul-kmr-jha', 'type': 'User'}]
